import React from "react";
import { Grid } from '@material-ui/core';

import Product from "./Product/Product";

const products = [
    { id: 1, name: 'Shoes', description: 'Running Shoes', price: '10000',image:'https://static.nike.com/a/images/t_PDP_1280_v1/f_auto,q_auto:eco/87bf5e39-899e-4fba-8749-4a367224e7d0/zoom-fly-5-road-running-shoes-lkx7Zp.png' },
    { id: 2, name: 'Macbook', description: 'Apple macbook', price: '20000',image:'https://www.bihouse.vn/img_data/images/733301937685-MBA-M1.jpg' }
]

const Products = () => {
    return (
        <main>
            <Grid container justify='center' spacing={4}>
                {products.map(product => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    )
}

export default Products;
